import React from "react";
import { Link } from "react-router-dom";

const Rentals = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-lg-6">
          <Link><h1>Add New Rental</h1></Link>
        </div>
      </div>
    </div>
  );
};

export default Rentals;
